import React, { useState, useEffect, useRef } from 'react';
import './style.css'; // Make sure this path is correct

const HomePage = () => {
  const [articles, setArticles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const searchInputRef = useRef(null);

  // 03465d97f8e74619917d549b2458490e
  const API_KEY = "71146ebefc69425aa26e16e6e9e066d1"; 

  useEffect(() => {
    fetchNews("india");
  }, []);

  const fetchNews = async (query) => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch(
        `https://newsapi.org/v2/everything?q=${query}&apiKey=${API_KEY}&pageSize=20`
      );

      if (!response.ok) {
        throw new Error(`NewsAPI error: ${response.status}`);
      }

      const data = await response.json();
      if (data.articles && data.articles.length > 0) {
        setArticles(data.articles.filter(article => 
          article.title && 
          article.url &&
          article.description
        ));
      } else {
        setError('No articles found. Try a different search term.');
      }
    } catch (err) {
      setError(`Failed to load news: ${err.message}`);
      console.error("News fetch error:", err);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = () => {
    const query = searchInputRef.current?.value.trim();
    if (query) {
      fetchNews(query);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleSearch();
    }
  };

  return (
    <div className="app-container">
      <nav>
        <div className="main-nav">
          <div className="company-logo">
            <img src="logo16-1.png" alt="News Logo" />
          </div>

          <div className="nav-links">
            <ul>
              <li>Add Note</li>
              <li onClick={() => fetchNews("highlights")}>Highlights</li>
              <li>Bot</li>
            </ul>
          </div>

          <div className="search-bar assign">
            <input
              type="text"
              className="news-input"
              placeholder="Search news..."
              ref={searchInputRef}
              onKeyPress={handleKeyPress}
            />
            <button className="search-button" onClick={handleSearch}>
              <img src="srch.png" alt="Search" />
            </button>
          </div>
        </div>
      </nav>

      <main>
        {loading && (
          <div className="loading-message">Loading news...</div>
        )}

        {error && (
          <div className="error-message">{error}</div>
        )}

        {!loading && !error && (
          <div className="cards-container">
            {articles.map((article, index) => (
              <div className="card" key={`${article.url}-${index}`}>
                <div className="card-header">
                  <img
                    src={article.urlToImage || 'https://placehold.co/600x400?text=No+Image'}
                    alt={article.title}
                    onError={(e) => {
                      e.target.onerror = null;
                      e.target.src = 'https://placehold.co/600x400?text=No+Image';
                    }}
                  />
                </div>
                <div className="card-content">
                  <h3>{article.title}</h3>
                  <p className="news-source">
                    {article.source?.name || 'Unknown'} • {new Date(article.publishedAt).toLocaleDateString()}
                  </p>
                  <p className="news-description"> {article.description?.substring(0, 100)}...</p>
                </div>
              </div>
            ))}
          </div>
        )}
      </main>
    </div>
  );
};

export default HomePage;
